import Particles from 'react-particles-js';
import './Particles.css'

const particleOption={
                particles: {
                  number:{
                    value:30,
                    density:{
                      enable:true,
                      value_area:100
                    }
                  }
                  
                }
              }

const Particle=()=>{
	return(
   <div>
 <Particles className='particles' params={particleOption} />
   </div>
		)

}
export default Particle;
